contracts/Event.sol.content:
// SDPX-License-Identifier: MIT
pragma solidity ^0.8.3;

contract Event {
    event Log(string message, uint val);
    event IndexedLog(address indexed );

    function example() external {
        emit Log("Foo", 1234);
    }
}

